-- AA.clienti definition

CREATE TABLE `clienti` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL,
  `site` varchar(255) DEFAULT NULL,
  `city` varchar(100) DEFAULT NULL,
  `category` varchar(100) DEFAULT NULL,
  `email_1` varchar(150) DEFAULT NULL,
  `email_2` varchar(150) DEFAULT NULL,
  `email_3` varchar(150) DEFAULT NULL,
  `phone_1` varchar(30) DEFAULT NULL,
  `phone_2` varchar(30) DEFAULT NULL,
  `phone_3` varchar(30) DEFAULT NULL,
  `latitude` decimal(10,7) DEFAULT NULL,
  `longitude` decimal(10,7) DEFAULT NULL,
  `assign` varchar(100) DEFAULT NULL,
  `contact_method` varchar(50) DEFAULT NULL,
  `data_start` date DEFAULT NULL,
  `data_follow_up_1` date DEFAULT NULL,
  `data_follow_up_2` date DEFAULT NULL,
  `status` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `note` text,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

